const navStyle = {
 width:'100%',
 display: 'flex',
 height: '40px',
 background: '#280000',
 color:'#FDFFFF',
 textDecoration:'none',
 padding: '2em',
 font:'Roboto',
 fontWeight: 'bolder'

}    
    return(
        <ul style={navStyle}>
            <li>
                <Link href='/'><a>Home</a></Link>
            </li>
            <li>
                <Link href='/about'><a>Personajes de Rick y Morty</a></Link>
            </li>
        </ul>
    )
}
export default Navigation;
